    static int[] bubble(int[] arr){
        boolean swap;
        int len= arr.length-1;
        for (int i = 0; i < arr.length-1; i++) {
        swap=false;
            for (int j = 0; j <= len; j++) {
                if(arr[j]>arr[j+1]){
                    int temp=arr[j];
                    arr[j]=arr[j+1];
                    arr[j+1]=temp;
                    swap=true;
                    if (arr[len-1]<arr[len]&&temp==arr[len]){
                        len--;
                    }
                }
            }
            if (!swap){
                break;
            }

        }
        return arr;
    }

